import React from "react";

const ClearAll = (todo) => {
  todo.forEach((element) => {
    alert(element);
  });
};

const ClearAllTodos = () => {
  return (
    <div>
      <button
        onClick={() => {
          ClearAll([...todos]);
        }}
        className="border text-3xl text-white p-3"
      >
        Clear
      </button>
    </div>
  );
};

export default ClearAllTodos;
